// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import Register from './components/Register';
import LoanRequest from './components/LoanRequest';
import Payments from './components/Payments';
import LateLoans from './components/LateLoans';
import OverdueLoans from './components/OverdueLoans';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Dashboard} />
        <Route path="/register" component={Register} />
        <Route path="/loan-request" component={LoanRequest} />
        <Route path="/payments" component={Payments} />
        <Route path="/late-loans" component={LateLoans} />
        <Route path="/overdue-loans" component={OverdueLoans} />
      </Switch>
    </Router>
  );
};

export default App;
